css:
@-moz-document domain("travis-ci.org"), domain("travis-ci.com") {
  a, body, button, html,
  .topbar, .topbar a,
  .repo-header .repo-title a {
    color: #6e6; }

  .dashboard .centered, .dashboard .loading-page {
    background-color: black; }

  .job-lang:hover {
    background-color: #050505;
    border-bottom: 1px solid #EFF0EC; }

  .popup {
    color: #6e6;
    background-color: black;
    border: 10px solid #515; }

  #owner,
  .travis-footer,
  .footer, .footer-title, .footer-elem,
  .small-title-popup-title,
  .url, .no-button,
  .ember-application, .ember-text-area, .ember-view,
  #status-images,
  .display {
    color: #6e6;
    background-color: black; }

  .form-pair, .text-area,
  .select, .x-select {
    color: #6e6;
    background-color: #050505; }

  #main,
  .main, .loading-page,
  .wrapper, .wrappermain {
    background-color: black; }

  .log-header {
    color: #ddd;
    background-color: #050505; }

  .log-header a:hover {
    color: #ddd;
    background-color: #190919; }

  .fold {
    color: #6e6;
    background-color: #190919; }

  .fold-name {
    color: #0f0;
    background-color: black; }

  .duration {
    color: #0f0;
    background-color: black; }

  .log-body {
    color: #0f0;
    background-color: black; }

  .log-body .duration, .log-body .fold .fold-name {
    color: #0f0;
    background-color: black; }

  .navigation-nested {
    color: #0f0;
    background-color: black; }

  .navigation-nested a:hover {
    color: #a3f;
    background-color: #050505; }

  .profile-getstarted, .profile-repo:hover, .sidebar-list ul {
    color: #0f0;
    background-color: black; }

  .switch .switch-inner span {
    color: #0f0;
    background-color: #717; }

  .profile-orgs h1 {
    color: #0f0;
    background-color: black;
    border: 0 0 0 2px solid #414; }

  .switch .switch-inner {
    color: #0f0;
    background-color: #414; }

  .switch.active .switch-inner {
    color: #0f0;
    background-color: #414; }

  .log-body pre {
    color: #6e6;
    background-color: #010001; }

  .log-body .fold:not(.open) p:first-of-type {
    color: #0f0;
    background-color: #190919; }

  .top {
    position: relative;
    z-index: 2;
    box-shadow: 0 0 15px #111; }

  .owner-header img,
  .top,
  .search--sidebar .search-inner input:focus {
    background-color: #190919; }

  .main,
  #left,
  .option-dropdown {
    background-image: linear-gradient(45deg, #1e001e 25%, transparent 25%, transparent 75%, #1e001e 75%, #1e001e), linear-gradient(135deg, #1e001e 25%, transparent 25%, transparent 75%, #1e001e 75%, #1e001e);
    background-color: #050505;
    background-size: 4px 4px; }

  #left {
    border-right-color: #1a001a;
    box-shadow: 0 0 15px #111; }

  button,
  .action-button--cancel, .action-button--debug, .action-button--restart,
  .download-log-button, .remove-log-button, .toggle-log-button--dark,
  .search--sidebar .search-inner input,
  .option-display {
    background-color: #190919;
    color: #c3c;
    border-color: #111; }

  .travistab-nav--secondary a,
  .travistab-nav.travistab-nav--underline,
  .sidebar-list ul,
  .repo-navigation {
    border-bottom-color: #717; }

  .sidebar-list ul {
    background-color: #1a001a; }

  .build-header,
  .sidebar-seperator,
  .row-li {
    border-color: #190919; }

  #log {
    border: 2px solid #414;
    border-top-width: 0; }

  .tile.booting, .tile.created, .tile.queued, .tile.received, .tile.started {
    background: linear-gradient(to right, #edde3f 0, #edde3f 8px, #190919 8px, #190919 100%) no-repeat; }

  .tile {
    background: linear-gradient(to right, #39aa56 0, #39aa56 8px, #190919 8px, #190919 100%) no-repeat; }

  .tile.passed {
    background: linear-gradient(to right, #39aa56 0, #39aa56 8px, #190919 8px, #190919 100%) no-repeat; }

  .tile.errored, .tile.failed {
    background: linear-gradient(to right, #db4545 0, #db4545 8px, #190919 8px, #190919 100%) no-repeat; }

  .build-header.booting, .build-header.created, .build-header.queued, .build-header.received, .build-header.started {
    background: linear-gradient(to right, #edde3f 0, #edde3f 10px, #190919 10px, #190919 100%) no-repeat; }

  .build-header.passed {
    background: linear-gradient(to right, #39aa56 0, #39aa56 10px, #190919 10px, #190919 100%) no-repeat; }

  .build-header.errored, .build-header.failed {
    background: linear-gradient(to right, #db4545 0, #db4545 10px, #190919 10px, #190919 100%) no-repeat; }

  .row-li.booting, .row-li.created, .row-li.queued, .row-li.received, .row-li.started {
    background: linear-gradient(to right, #edde3f 0, #edde3f 10px, #190919 10px, #190919 100%) no-repeat; }

  .row-li.passed {
    background: linear-gradient(to right, #39aa56 0, #39aa56 10px, #190919 10px, #190919 100%) no-repeat; }

  .row-li.canceled {
    background: linear-gradient(to right, #9d3d9d 0, #9d3d9d 10px, #190919 10px, #190919 100%) no-repeat; }

  .row-li.errored, .row-li.failed {
    background: linear-gradient(to right, #db4545 0, #db4545 10px, #190919 10px, #190919 100%) no-repeat; }

  .build-commit:after {
    background: linear-gradient(-90deg, #190919 20%, rgba(50, 50, 50, 0) 100%); }

  @media screen and (min-width: 50.063em) {
    .commit-description:after {
      background: linear-gradient(360deg, #190919 5%, rgba(50, 50, 50, 0) 100%); }

    .tile h2:after,
    .pr-row .row-branch:after {
      background: linear-gradient(-90deg, #190919 0, rgba(50, 50, 50, 0) 100%); }

    .fade-out:after {
      background: linear-gradient(-90deg, #190919 30%, rgba(50, 50, 50, 0) 100%); }

    .pr-row .two-line:first-of-type {
      border-color: #190919; }

    .branch-row .row-last-build:before {
      background-color: #190919; }

    .option-tofu {
      border-color: #050505; } } }

